The problem describes a business scenario involving buying, transporting, and selling wheat bags. The trader buys wheat at $20 per bag, incurs $2 in transportation cost per bag, and sells the bags at $30 each. The profit is $400. We need to find the number of bags sold.

Let 'x' be the number of bags sold.
The total cost of buying the bags is 20x.
The total transportation cost is 2x.
The total cost is 20x + 2x = 22x.
The total revenue from selling the bags is 30x.
The profit is the total revenue minus the total cost: 30x - 22x = 8x.
We are given that the profit is $400, so 8x = 400.
Solving for x, we get x = 400 / 8 = 50.

Therefore, the trader sold 50 bags.

